Staines library is currently located on Friends Walk on the edge of the town centre. The building is in a poor state of repair and requires investment both in terms of building condition and service fit out.   Through partnership working, with Spelthorne Borough Council, an opportunity to provide a new hub for the locality has been developed. This will provide a multi-use facility, occupied by variety of services and partners whilst also enabling use by third party and community group organisations. The key services to be co-located in the first instance as part of the hub are:  
      
      Library; 
      
      Registrars; 
      
      Museum; 
      
      Partners such as Citizens Advice and Voluntary Action. 
      
      In Staines, the specific offer is designed in response to local data, which tells us that it is an area with low adult skills, high health inequalities and low employment. This has been validated with the local community through an ongoing process of co-design. The offer is reflective of the Carnegie model, with a focus on those aspects most relevant to local priorities and will enable delivery of elements not currently delivered within Staines Library. This targeted approach enables the greatest impact in terms of the benefits and outcomes identified above.

The BBC is looking to appoint two suppliers to a Framework Agreement. Suppliers will be providing a range of services including but not limited to Accessibility Training and Learning, Accessibility Consultancy, Accessibility and Inclusive Design reviews against industry and BBC accessibility guidelines and standards as well as support with non W3C complaint technologies.

A detailed specification is set out in Section C - Specification Of Requirements in the ITT document.

The spend range over the 4 year term is between £400,000 to £600,000

The spend ranges are not committed spend ranges, and are therefore "only an
estimation" of spend that could be made through the Framework Agreement.

Additional information: 
Please register your interest in this project by taking the following steps:
1) Register your company on the Jaggaer e-Tendering portal (this is only required once):
1.1 Go to https://bbc.bravosolution.co.uk
1.2 Click the link on the login page to register;
1.3 Accept the terms and conditions and click &apos;Continue&apos;;
1.4 Enter your correct business and user details;
1.5 Note the username you chose and click &apos;Save&apos; when complete;
1.6 You will shortly receive an email with your temporary password.
2) Express an interest in the tender:
2.1 Login to the portal with the username/password;
2.2 Click the &apos;PQQs/ITTs Open to all Suppliers&apos; link. (These are Pre-Qualification
Questionnaires or Invitations to Tender open to any registered supplier).
2.3 Click on the relevant PQQ/ITT to access the content;
2.4 Click the &apos;Express Interest&apos; button at the top of the page. This will move the PQQ/ITT into your &apos;My PQQs/My ITTs page. (This is a secure area reserved for your projects only;
2.5 You can now access any attachments by clicking &apos;Buyer Attachments&apos; in the &apos;PQQ/ITT Details&apos;box.
3) Responding to the tender:
3.1 Click &apos;My Response&apos; under PQQ/ITT Details&apos;, you can choose to &apos;Create Response&apos; or to &apos;Decline to Respond&apos; (please give a reason if declining);
3.2 You can now use the &apos;Messages&apos; function to communicate with the buyer and seek any clarification;
3.3 Note the deadline for completion, and then follow the onscreen instructions to complete the PQQ/ITT. There may be a mixture of online and offline actions for you to perform (there is detailed online help available)
3.4 You must then submit your reply using the &apos;Submit Response&apos; button at the top of the page. If you require any further assistance, please consult the online help, or contact the Jagger e-Tendering help desk.

This notice is placed as a Prior Information Notice (PIN) in relation to a pre-procurement market questionnaire. 

NHS Somerset ICB (the Commissioner) invites expressions of interest (EOI) from suitably qualified and experienced Providers, to provide Mandatory Dental Services within the Chard and Crewkerne area. 

The indicative date for the contract to commence is 1st April 2025. The annual contract value is expected to be in the region of £1.2 million, although this is to be confirmed.

The aims for Mandatory Dental Service provision are to: 
•	contribute to improving oral and general health; 
•	reduce inequalities in health and access to dental care by providing extra support to groups of vulnerable adults and children.  This includes, but is not limited to, children under 5 years old, residents of care homes, patients weighing up to 300kg (47 stones) and other vulnerable groups;
•	provide access to NHS dental services to ensure equity and consistency of provision;
•	provide bookable appointments outside of core hours;
•	deliver appropriate, efficient and cost-effective services within the service provision framework of the NHS (General Dental Services/Personal Dental Services) Regulations 2005 and any subsequent revisions;
•	provide high quality dental services;
•	provide access within contracted hours to unassociated patients identified as having an urgent dental need via NHS 111, NHS Dental Helpline, out of hours services and self-referral;
•	refer patients to other NHS services as appropriate in line with the relevant local protocols and guidance;
•	establish a positive working relationship between the Commissioner and Provider to facilitate and maximise high quality service delivery;
•	develop services in line with the evolving strategic approach to primary care dental provision and align with the priorities of the NHS Long Term Plan - www.longtermplan.nhs.uk;
•	promote overall health in line with Making Every Contact Count.

Providers who wish to express their interest and complete the questionnaire can follow the below link which will take you through to the Microsoft Form; 

https://forms.office.com/e/BJ0FnK1zvi

Please complete and submit your questionnaire by Wednesday 11th September.

This exercise is being carried out by NHS South, Central and West Commissioning Support Unit (SCW) on behalf of the Commissioner.

Additional information: This notice is an information gathering exercise rather than a call for competition in its own right, and therefore publication or response does not commit the Authority or respondents to a future procurement, nor provide any process exemptions or preferential treatment to any parties expressing an interest. The Authority will not be liable for costs incurred by any interested party in participating in this exercise.  

This is a Provider Selection Regime (PSR) prior information notice. The contract is subject to the Health Care Services (Provider Selection Regime) Regulations 2023. For the avoidance of doubt, the provisions of the Public Contracts Regulations 2015 do not apply.
